--step1: regex find duplicate rf: ^(.*)(\r?\n\1)+$ or ^(.*)\t(\d+)(\r?\n\1)+\t\d+$, replace: \1
--step2: regex find: (.*)\t(\d+), replace INSERT INTO orgunit (id, version, parent, type, name, address, city) VALUES (100\2, 1, null, 'РФ', '\1', null, null);
--step3: regex find: (.*)\t(.*)\t(\d+), replace INSERT INTO orgunit (id, version, parent, type, name, address, city) VALUES (200\3, 1, (SELECT id FROM orgunit WHERE type = 'РФ' AND NAME ='\1'), 'ВСП', '\3', null, '\2');
--step4: find duplicate id - VALUES \((\d+),.*(\r?\n.*VALUES \(\1)+

